'use strict';

/*
** Quickly put together function that allows me 
** to test the application from a test page I set up
*/

(function () {

	// base64 dummy data to send
	var imgData = 'data:image/png;base64,';

	// grabbing DOM elms
	var sendTextBtn = document.querySelector('.send-text-button');
	var phoneNumberInput = document.querySelector('.phone-number');
	var status = document.querySelector('.status');
	var testImg = document.querySelector('.test-img');
	var message = "You were an awesome time-traveler! Share your pic using #IKEATimeMachine";

	// load the empty image with the base64 data
	testImg.src = imgData;

	// hit twilio endpoint on click of button
	sendTextBtn.addEventListener('click', function () {
		console.log('Send Text');

		var phoneNumber = phoneNumberInput.value;

		if (!phoneNumber) return null;

		console.log(phoneNumber, imgData, message);

		var apiURL = 'http://localhost:3002/api/send-text';
		new Promise(function (resolve, reject) {
			fetch(apiURL, {
				method: 'POST',
				headers: {
					'Content-Type': 'application/json'
				},
				body: JSON.stringify({
					"phoneNumber": phoneNumber,
					"imgData": imgData,
					"message": message
				})
			}).then(function (response) {
				resolve(response);
				console.log(response);
				status.innerHTML = 'Your text has sent to the </br>NodeJS server successfully';
			}).catch(function (error) {
				console.log(error);
				status.innerHTML = 'Error: ' + error;
				reject(error);
			});
		});
	});
})();

